  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`RedisJSON is a Redis module that lets you store JSON documents in Redis. It is a JSON data type for Redis that lets you to fetch or modify a specific element in the document tree, without retrieving (or internally even parsing) the document. Its Python client even lets you store python dicts and convert them to JSON automatically.`}</p>
    <h3 {...{
      "id": "redisjson-python-client"
    }}>{`RedisJSON Python Client`}</h3>
    <p>{`The 'rejson-py' is a package that allows storing, updating and querying objects as JSON documents in a Redis database that is extended with the ReJSON module. The package extends redis-py's interface with ReJSON's API, and performs on-the-fly serialization/deserialization of objects to/from JSON.`}</p>
    <p>{`Follow the steps below to get started with RedisJSON with Python:`}</p>
    <h3 {...{
      "id": "step-1-run-redisjson-docker-container"
    }}>{`Step 1. Run RedisJSON Docker container`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` docker run -p 6379:6379 --name redis-redisjson redislabs/rejson:latest
`}</code></pre>
    <h3 {...{
      "id": "step-2-verify-if-redisjson-module-is-loaded"
    }}>{`Step 2. Verify if RedisJSON module is loaded`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` redis-cli
 127.0.0.1:6379> info modules
 # Modules
 module:name=ReJSON,ver=10007,api=1,filters=0,usedby=[],using=[],options=[]
 127.0.0.1:6379> 
`}</code></pre>
    <h3 {...{
      "id": "step-3-storing-the-json-document"
    }}>{`Step 3. Storing the JSON document`}</h3>
    <p>{`Let us consider a simple JSON document structure:`}</p>
    <pre><code parentName="pre" {...{}}>{`employee
 {
  "name": "Paul John",
  "age": 25,
  "location: "USA"
 }
`}</code></pre>
    <p>{`Below is a python code to store the JSON document into Redis:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-python"
      }}>{`from rejson import Client, Path


rj = Client(host='localhost', port=6379, decode_responses=True)

employee = {

     'name': "Paul", 
     'Age': '25', 
     'Location': "USA"
   }
rj.jsonset('employee', Path.rootPath(), employee)
`}</code></pre>
    <p>{`In the code above, we use JSON.GET to extract the JSON elements. Save the above file as "employee.py".`}</p>
    <h3 {...{
      "id": "step-4-load-redis-module"
    }}>{`Step 4. Load Redis Module`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` pip  install rejson
`}</code></pre>
    <h3 {...{
      "id": "step-5-execute-the-python-script"
    }}>{`Step 5. Execute the python script`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` python3 employee.py
`}</code></pre>
    <h3 {...{
      "id": "step-6-verify-the-json-document-added-to-redis"
    }}>{`Step 6. Verify the JSON document added to Redis`}</h3>
    <b>Command</b>:
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` 127.0.0.1:6379> JSON.GET employee
`}</code></pre>
    <b>Result</b>:
    <pre><code parentName="pre" {...{}}>{` "{\\"name\\":\\"Paul\\",\\"Age\\":\\"25\\",\\"Location\\":\\"USA\\"}"
 127.0.0.1:6379> 
`}</code></pre>
    <h3 {...{
      "id": "step-7-fetching-the-specific-fields-within-json-document"
    }}>{`Step 7. Fetching the specific fields within JSON document`}</h3>
    <p>{`It's possible to fetch specific field within JSON element. Let us modify the above code and add "address" field as shown below:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-python"
      }}>{` from rejson import Client, Path


rj = Client(host='localhost', port=6379, decode_responses=True)

employee = {

     'name': "Paul", 
     'Age': '25', 
     'address': {
        'location': "USA"
   }
  }
rj.jsonset('employee', Path.rootPath(), employee)
rj.jsonget('employee', Path('.address.location'))
`}</code></pre>
    <p>{`In the above example, the code tries to fetch only the location under the address field.`}</p>
    <h3 {...{
      "id": "step-8-verifying-the-results"
    }}>{`Step 8. Verifying the results`}</h3>
    <b>Command</b>:
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` 127.0.0.1:6379> JSON.GET employee .address.location
`}</code></pre>
    <b>Results</b>:
    <pre><code parentName="pre" {...{}}>{` "\\"USA\\""
`}</code></pre>
    <h3 {...{
      "id": "references"
    }}>{`References`}</h3>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/howtos/redisjson/storing-complex-json-document"
        }}>{`How to store and retrieve nested JSON document`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/howtos/redisjson/using-nodejs"
        }}>{`Importing JSON data into Redis using NodeJS`}</a></li>
      <li parentName="ul">{`Learn more about `}<a parentName="li" {...{
          "href": "https://oss.redislabs.com/redisjson/"
        }}>{`RedisJSON`}</a>{` in the Quickstart tutorial.`}</li>
    </ul>
    </MDXLayout>;
}

